#include <stdio.h>
void sum_diff(float op1,float op2,float *psum,float *pdiff); 
int main()
{
  float a,b,sum,diff;
  scanf("%f %f",&a,&b);
  sum_diff(a,b,&sum,&diff);
  printf("%.2f\n%.2f",sum,diff);
  return 0;
}
void sum_diff(float op1,float op2,float *psum,float *pdiff)
{
	*psum=op1+op2;
	if(op1>op2)
	*pdiff=op1-op2;
	else
	*pdiff=op2-op1;
}

